import Home from './Home';

function App() {
  return (
    <div>
          <Header />
    <Routes>
      <Route path="/" element={<Home />} />
    </Routes>
      {patients.map(patient=>{
        return (
          <p>Patient: {patient.name}</p>
        )
      })}
        {providers.map(provider=>{
        return (
          <p>Provider: {provider.name}</p>
        )
      })}


    </div>
  );
}

